return ['domain'=>NULL,'plural-forms'=>'nplurals=3; plural=(n==1 ? 0 : n%10>=2 && n%10<=4 && (n%100<12 || n%100>14) ? 1 : 2);','language'=>'pl','pot-creation-date'=>'2026-02-04 13:07-0600','po-revision-date'=>'2026-02-04 13:07-0600','translation-revision-date'=>'2026-02-04 13:07-0600','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.8','messages'=>['%1$s is currently %2$spaused%3$s, and is not serving calendars on front end pages. You can resume serving calendars under the %4$sUtilities%5$s tab %6$shere%7$s.'=>'%1$s jest obecnie %2$swstrzymany%3$s i nie obsługuje kalendarzy na stronach frontowych. Możesz wznowić obsługę kalendarzy w zakładce %4$sNarzędzia%5$s %6$stutaj%7$s.','%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sKorzystasz z kalendarza ICS w implementacji WordPress Playground.%2$s Ponieważ kalendarz ICS jest przeznaczony do działania na serwerze internetowym, niektóre funkcje mogą być niedostępne lub mogą nie działać prawidłowo.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sTwoja witryna korzysta obecnie z ustawienia strefy czasowej opartego na przesunięciu UTC.%2$s Może to powodować błędy wyświetlania czasu w %3$swtyczce w lokalizacjach, w których obowiązuje czas letni. Aby zapewnić prawidłowe wyświetlanie czasu, %4$szmień ustawienie strefy czasowej%5$s na miasto najbliższe Twojej lokalizacji, w tej samej strefie czasowej. Dodatkowe informacje na ten temat można znaleźć w naszej %6$sdokumentacji%7$s.','Important! Your %1$s configuration appears to be exceeding source calendar provider rate limits.'=>'Ważne! Twoja konfiguracja %1$s wydaje się przekraczać limity dostawcy kalendarza źródłowego.','If your calendars are not loading properly, please review your %1$s settings and usage:'=>'Jeśli kalendarze nie ładują się prawidłowo, sprawdź ustawienia i sposób użytkowania %1$s:','Do not use %1$s in your shortcodes. This feature is intended for troubleshooting only, and should not be left on permanently.'=>'Nie używaj %1$s w skrótach. Ta funkcja służy wyłącznie do rozwiązywania problemów i nie powinna być pozostawiona włączona na stałe.','Increase the %1$s %2$sTransient (cache) expiration%3$s setting to %4$s43200%5$s (12 hours) or greater, to reduce the frequency of requests to the provider. (See note below.)'=>'Zwiększ ustawienie %1$s %2$sWygaśnięcie tymczasowe (pamięć podręczna) %3$s do %4$s43200%5$s (12 godzin) lub więcej, aby zmniejszyć częstotliwość żądań kierowanych do dostawcy. (Zobacz uwagę poniżej).','Avoid including a large number of feeds (10 or more) from the same provider in a single %1$s shortcode.'=>'Unikaj umieszczania dużej liczby kanałów (10 lub więcej) od tego samego dostawcy w jednym skrócie %1$s.','Temporarily pause ICS Calendar on your front-end pages using the %1$sPause Calendars%2$s utility. (24-48 hours is recommended.)'=>'Tymczasowo wstrzymaj działanie kalendarza ICS na stronach front-endowych za pomocą narzędzia %1$sWstrzymaj kalendarze%2$s. (Zalecany czas to 24–48 godzin).','%1$s includes built-in caching, specifically to improve performance and avoid exceeding provider rate limits. Circumventing this caching with a very low %2$sreload%3$s setting may trigger a temporary block on your web server IP address, or possibly on your entire hosting network, by the calendar provider.'=>'%1$s zawiera wbudowaną funkcję buforowania, która ma na celu poprawę wydajności i uniknięcie przekroczenia limitów szybkości dostawcy. Ominięcie tej funkcji buforowania poprzez ustawienie bardzo niskiego poziomu %2$sreload%3$s może spowodować tymczasowe zablokowanie adresu IP serwera WWW lub nawet całej sieci hostingowej przez dostawcę kalendarza.','After making the recommended changes, please allow up to 24 hours for your calendar provider to remove any temporary blocks on your IP address. If you find that the problem persists, please use our %1$ssupport request form%2$s to contact us, and be sure to include your %3$ssystem report%4$s.'=>'Po wprowadzeniu zalecanych zmian poczekaj do 24 godzin, aż dostawca kalendarza usunie wszelkie tymczasowe blokady adresu IP. Jeśli problem nadal występuje, skontaktuj się z nami za pomocą %1$sformularza zgłoszenia pomocy technicznej%2$s i dołącz %3$sraport systemowy%4$s.','Note: Set the %1$sTransient (cache) expiration%2$s as large as possible, considering how frequently event information in your calendar is typically updated. %3$s Remember that you can use the %4$sClear Cached Calendar Data%5$s utility to manually clear the cache at any time, if needed.'=>'Uwaga: Ustaw wartość %1$sTransient (cache) expiration%2$s na jak najwyższą, biorąc pod uwagę częstotliwość aktualizacji informacji o wydarzeniach w kalendarzu. %3$s Pamiętaj, że w razie potrzeby możesz w dowolnym momencie ręcznie wyczyścić pamięć podręczną za pomocą narzędzia %4$sClear Cached Calendar Data%5$s.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sUwaga:%2$s W %3$s wersji 10.6 zmieniono domyślne ustawienia kilku skrótów. Aby zachować spójność, te nowe ustawienia domyślne %4$snie%5$s są włączane automatycznie podczas aktualizacji z wcześniejszej wersji. Aby dowiedzieć się więcej o zmianach, przeczytaj nasz %6$swpis na blogu%7$s, lub aby przełączyć się na nowe ustawienia domyślne, włącz opcję %8$s na stronie %9$s ustawień%10$s.','Use new parameter defaults (v.10.6)'=>'Użyj nowych domyślnych parametrów (wersja 10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sUwaga:%2$s %3$s wersja 11.0 usprawnia sposób pobierania adresów URL kanałów ICS. Zmiana ta wykorzystuje standardową wbudowaną funkcję WordPressa, więc powinna być w pełni kompatybilna ze wszystkimi istniejącymi instalacjami. Jeśli po aktualizacji do wersji 11 lub nowszej napotkasz jakiekolwiek nowe problemy, odwiedź %4$sforum pomocy technicznej WordPressa%5$s, aby uzyskać pomoc.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sUwaga:%2$s %3$s wersja 11.5.14.2 wprowadza nową, bezpieczniejszą metodę obsługi parametrów kalendarza podczas ładowania za pomocą AJAX. Proszę wyczyścić wszystkie używane wtyczki buforujące, aby zapewnić prawidłowe ładowanie kalendarzy przy użyciu nowej metody.','%1$sWelcome to %2$s version 12!%3$s Version 12.0 introduces additional troubleshooting tools, plus a number of performance improvements and interface refinements throughout. Please see the %4$schangelog%5$s for more details on this update.'=>'%1$sWitamy w %2$s wersji 12!%3$s Wersja 12.0 wprowadza dodatkowe narzędzia do rozwiązywania problemów, a także szereg ulepszeń wydajności i udoskonaleń interfejsu. Więcej szczegółów na temat tej aktualizacji można znaleźć w %4$sdzienniku zmian%5$s.','Getting Started'=>'Pierwsze kroki','Settings'=>'Ustawienia','Appearance'=>'Wygląd','Utilities'=>'Narzędzia','System Report'=>'Raport systemu','Support'=>'Wsparcie','Upgrade to %1$s!'=>'Zaktualizuj do wersji %1$s!','Show/hide all'=>'Pokaż/ukryj wszystko','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'Nie można pobrać pliku ICS lub plik jest pusty. Sprawdź, czy adres URL jest poprawny, a także sprawdź konfigurację pliku php.ini, aby upewnić się, że funkcja cURL lub allow_url_fopen jest dostępna. Jeśli używasz spacji do oddzielania wielu adresów URL, możesz również spróbować użyć znaku rury. Adres URL, którego dotyczy problem:','Hide past events'=>'Ukryj minione wydarzenia','Show past events'=>'Pokaż wydarzenia które były już','Contact:'=>'Skontaktuj się z:','Resources:'=>'Zasoby:','Click for more...'=>'Kliknij, aby dowiedzieć się więcej...','Save to your calendar'=>'Zapisz w kalendarzu','Cancelled'=>'Anulowane','The legacy parser option is deprecated and will be removed in a future update.'=>'Opcja legacy parser jest przestarzała i zostanie usunięta w przyszłej aktualizacji.','Print'=>'Drukuj','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'Atrybut skrótu „currentweek” jest przestarzały. Zamiast niego należy używać view="week" w skrócie.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Atrybut skrótu „legendinline” jest przestarzały. Zamiast niego należy używać legendstyle="inline" w skrócie.','%1$s has %2$sresumed%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s %2$swznowił%3$s wyświetlanie kalendarzy na stronach głównych. Jeśli Twoja witryna korzysta z wtyczki do buforowania, może być konieczne wyczyszczenie pamięci podręcznej.','%1$s has %2$spaused%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s %2$swstrzymał%3$s wyświetlanie kalendarzy na stronach głównych. Jeśli Twoja witryna korzysta z wtyczki do buforowania, może być konieczne wyczyszczenie pamięci podręcznej.','Cleared %1$s %2$s transient(s).'=>'Wyklarowano %1$s %2$s przejściowe.','No %1$s transients were found.'=>'Nie znaleziono żadnych %1$s przejść.','All saved ICS feed URLs have been cleared.'=>'Wszystkie zapisane adresy URL kanałów ICS zostały usunięte.','All %1$s settings have been reset to defaults, and saved ICS feed URLs have been cleared.'=>'Wszystkie %1$s ustawienia zostały zresetowane do wartości domyślnych, a zapisane adresy URL kanałów ICS zostały usunięte.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Twój adres URL kanału wydaje się zawierać dane uwierzytelniające HTTP Basic Authentication. Spróbuj wyłączyć opcję %1$s w zakładce %2$s powyżej.','Use legacy feed request method'=>'Użyj starszej metody żądania kanału','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sTen adres URL wskazuje plik w bibliotece multimediów.%2$s Chociaż adres ten powinien działać w skrócie %3$s, będzie to statyczna migawka kalendarza z momentu utworzenia pliku i nie będzie odzwierciedlać przyszłych aktualizacji kalendarza źródłowego. Instrukcje dotyczące uzyskania prawidłowego dynamicznego adresu URL kanału można znaleźć w %4$sinstrukcji obsługi%5$s.','Error: Could not resolve IP address for %1$s.'=>'Błąd: Nie można rozwiązać adresu IP dla %1$s.','Resolved IP address for %1$s:'=>'Rozwiązany adres IP dla %1$s:','%1$sAppearance updated.%2$s You may need to refresh the page to see some changes.'=>'%1$s Wygląd został zaktualizowany. %2$s Aby zobaczyć niektóre zmiany, może być konieczne odświeżenie strony.','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Tekst wprowadzony w polu „Domyślny skrót” nie jest prawidłowym skrótem i nie został zapisany.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sUstawienia zaktualizowane.%2$s Aby zobaczyć niektóre zmiany, może być konieczne odświeżenie strony.','calendar event'=>'wydarzenie w kalendarzu','Event download failed.'=>'Pobieranie wydarzenia nie powiodło się.','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Metoda żądania starszego typu została wycofana i zostanie usunięta w najbliższej aktualizacji. Prosimy o przetestowanie kanałów przy wyłączonej metodzie żądania starszego typu.','Future updates of %1$s will require WordPress 5.3 or newer. Please update your site to a newer version of WordPress as soon as possible.'=>'Przyszłe aktualizacje %1$s będą wymagały WordPress 5.3 lub nowszego. Proszę jak najszybciej zaktualizować swoją stronę do nowszej wersji WordPress.','An error occurred with %1$s while attempting to copy language translation files. The required PHP filesystem function %2$s is unavailable. This is required to address a conflict with certain translation customization plugins such as %3$s. As a result, %1$s translations may not load properly while the conflicting translation plugin is active.'=>'Wystąpił błąd %1$s podczas próby skopiowania plików tłumaczeń językowych. Wymagana funkcja systemu plików PHP %2$s jest niedostępna. Jest to konieczne, aby rozwiązać konflikt z niektórymi wtyczkami dostosowującymi tłumaczenia, takimi jak %3$s. W rezultacie tłumaczenia %1$s mogą nie ładować się poprawnie, gdy aktywna jest powodująca konflikt wtyczka tłumaczeniowa.','Map'=>'Mapa','Recurring event'=>'Wydarzenie cykliczne','Recurs every %1$s years'=>'Powtarza się co %1$s lat','Recurs yearly'=>'Powtarza się co roku','Recurs every %1$s months'=>'Powtarza się co %1$s miesięcy','Recurs monthly'=>'Powtarza się co miesiąc','Recurs every %1$s weeks'=>'Powtarza się co %1$s tygodni','Recurs weekly'=>'Powtarza się co tydzień','Recurs every %1$s days'=>'Powtarza się co %1$s dni','Recurs daily'=>'Powtarza się codziennie','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Właściwość „url” w skrócie %1$s wydaje się zawierać tagi HTML; najprawdopodobniej adres URL został przekształcony w klikalny link. W rezultacie kalendarz może nie wyświetlać się poprawnie. Usuń klikalny link ze skrótu.','The r34ics_url_get_contents() function is no longer supported.'=>'Funkcja r34ics_url_get_contents() nie jest już obsługiwana.','Add %1$s'=>'Dodaj %1$s','Close'=>'Zamknij','ICS Feed URL:'=>'Adres URL kanału ICS:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Upewnij się, że używasz adresu URL %1$ssubskrypcji%2$s, a nie adresu URL %3$swidoku internetowego%4$s.%5$s (Wprowadzenie adresu URL bezpośrednio w przeglądarce internetowej powinno spowodować pobranie pliku %6$s).','Calendar Title:'=>'Tytuł kalendarza:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Pozostaw puste, aby użyć domyślnego tytułu kalendarza. Wpisz %1$s, aby całkowicie pominąć tytuł.','Calendar Description:'=>'Opis kalendarza:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Pozostaw puste, aby użyć domyślnego opisu kalendarza. Wpisz %1$s, aby całkowicie pominąć opis.','View:'=>'Widok:','month'=>'miesiąc','list'=>'lista','week'=>'tydzień','Count:'=>'Licznik:','Format:'=>'Format:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Pozostaw %1$s puste, aby uwzględnić wszystkie nadchodzące wydarzenia. %2$s musi być standardowym %3$sciągiem znaków formatu daty PHP%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Pokaż opisy wydarzeń %1$s (zmień na liczbę w wstawionym skrócie, aby ustawić limit słów) %2$s','Show event locations %1$s(if available)%2$s'=>'Pokaż lokalizacje wydarzeń %1$s (jeśli dostępne) %2$s','Show event organizers %1$s(if available)%2$s'=>'Pokaż organizatorów wydarzenia %1$s (jeśli dostępne) %2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sUwaga:%2$s Dodatkowe %3$sopcje wyświetlania%4$s są dostępne po ręcznej edycji skrótu po wstawieniu.','Insert %1$s'=>'Wstaw %1$s','Do even more with %1$s version 6!'=>'Zrób jeszcze więcej dzięki wersji 6 %1$s!','Calendar Builder + Block Editor'=>'Kreator kalendarza + edytor bloków','Configure all calendar settings with an easy visual interface, and use the new %1$s block to select your saved calendars from a dropdown in the Block Editor, no shortcode needed! %2$sLearn more...%3$s'=>'Skonfiguruj wszystkie ustawienia kalendarza za pomocą prostego interfejsu wizualnego i użyj nowego bloku %1$s, aby wybrać zapisane kalendarze z listy rozwijanej w edytorze bloków, bez konieczności stosowania skrótów! %2$sDowiedz się więcej...%3$s','Additional Views and Enhanced Features'=>'Dodatkowe widoki i ulepszone funkcje','%1$s offers many new ways to display your calendar, including integrations with the popular %2$s and %3$s open source libraries. Month and year views with a sidebar for the selected day. "Up Next" works great for radio or TV station schedules. Widget and year availability are perfect for holiday bookings. Plus, additional capabilities are added to the core Month, Basic, List and Week views. %4$sView sample calendars...%5$s'=>'%1$s oferuje wiele nowych sposobów wyświetlania kalendarza, w tym integrację z popularnymi bibliotekami open source %2$s i %3$s. Widoki miesięczne i roczne z paskiem bocznym dla wybranego dnia. Funkcja „Up Next” doskonale sprawdza się w przypadku ramówek stacji radiowych lub telewizyjnych. Widżety i dostępność roczna są idealne do rezerwacji wakacyjnych. Ponadto do podstawowych widoków miesięcznych, podstawowych, listowych i tygodniowych dodano dodatkowe funkcje. %4$sZobacz przykładowe kalendarze...%5$s','Customization'=>'Dostosowanie','Easy-to-use tools to completely customize your calendar colors, typography and more. Select one of our preset color palettes or create your own, with options to individually customize the color of each element in the calendar layout. Choose between your theme fonts, system fonts, or more than 20 included open source fonts. %1$sLearn more...%2$s'=>'Łatwe w użyciu narzędzia do pełnej personalizacji kolorów kalendarza, typografii i innych elementów. Wybierz jedną z naszych gotowych palet kolorów lub stwórz własną, korzystając z opcji indywidualnej personalizacji koloru każdego elementu układu kalendarza. Wybierz spośród czcionek motywu, czcionek systemowych lub ponad 20 dołączonych czcionek open source. %1$sDowiedz się więcej...%2$s','ICS Events'=>'Wydarzenia ICS','Turns %1$s into a full calendar management system. Create and edit new events directly in WordPress, and even integrate them seamlessly with your existing external ICS feeds. %2$sLearn more...%3$s'=>'Zmienia %1$s w pełny system zarządzania kalendarzem. Twórz i edytuj nowe wydarzenia bezpośrednio w WordPressie, a nawet integruj je płynnie z istniejącymi zewnętrznymi kanałami ICS. %2$sDowiedz się więcej...%3$s','Localized Admin Interface'=>'Lokalny interfejs administracyjny','All %1$s admin pages are translated into dozens of languages, including English, Czech, Danish, German, Greek, Spanish, Estonian, Finnish, French, Hungarian, Italian, Japanese, Korean, Lithuanian, Latvian, Norwegian, Dutch, Polish, Portuguese, Romanian, Russian, Slovak, Serbian, Swedish, Turkish, Ukrainian, and Chinese.'=>'Wszystkie %1$s strony administracyjne są przetłumaczone na dziesiątki języków, w tym angielski, czeski, duński, niemiecki, grecki, hiszpański, estoński, fiński, francuski, węgierski, włoski, japoński, koreański, litewski, łotewski, norweski, holenderski, polski, portugalski, rumuński, rosyjski, słowacki, serbski, szwedzki, turecki, ukraiński i chiński.','Visit %1$s to learn more.'=>'Odwiedź stronę %1$s, aby dowiedzieć się więcej.','Calendar Builder screenshot'=>'Zrzut ekranu z programu Calendar Builder','Appearance screenshot'=>'Zrzut ekranu wyglądu','Available now!'=>'Już dostępne!','Get %1$s!'=>'Zdobądź %1$s!','Extensive color palette and typography options are available with %1$s. %2$sLearn More%3$s'=>'Szeroka paleta kolorów i opcje typograficzne są dostępne w %1$s. %2$sDowiedz się więcej%3$s','Color Palette'=>'Paleta kolorów','Match calendar color palette to current Block Theme colors'=>'Dopasuj paletę kolorów kalendarza meczów do aktualnych kolorów motywu blokowego.','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Zastępuje domyślną paletę neutralnych kolorów %1$s najbliższymi dopasowaniami z bieżącej palety kolorów edytora witryny lub pliku %2$s w motywie. Wybór kolorów odbywa się algorytmicznie, a niektóre kombinacje mogą nie przejść testów kontrastu dostępności. To ustawienie nie ma wpływu, jeśli używasz „klasycznego” motywu, który nie zawiera pliku %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar appearance or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sJest to obecnie funkcja w wersji beta.%2$s Aby uzyskać optymalny wygląd, może być konieczne wprowadzenie pewnych zmian w wyglądzie kalendarza lub arkuszu CSS, zwłaszcza jeśli kanały są oznaczone kolorami. Funkcjonalność może ulec zmianie.','Dark mode'=>'Tryb ciemny','Inverts color palette (light colors on a dark background).'=>'Odwraca paletę kolorów (jasne kolory na ciemnym tle).','Save Changes'=>'Zapisz zmiany','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Dziękujemy za zainstalowanie %1$s. Przed utworzeniem pierwszego skrótu kalendarza prosimy przejść do strony %2$sUstawienia ogólne%3$s i sprawdzić, czy ustawienia języka witryny, strefy czasowej oraz formatu daty i godziny są prawidłowe. Więcej informacji można znaleźć w naszym %4$sPodręczniku użytkownika%5$s.','Get started with %1$s in four easy steps... and you\'ve already completed step one! Check out our %2$sQuick Start Guide%3$s for the rest.'=>'Rozpocznij pracę z %1$s w czterech prostych krokach... i już wykonałeś pierwszy krok! Zapoznaj się z naszym %2$sPrzewodnikiem szybkiego startu%3$s, aby dowiedzieć się więcej.','Quick Start Guide'=>'Skrócona instrukcja obsługi','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Obszerny %1$sPodręcznik użytkownika%2$s jest dostępny na naszej stronie internetowej. Poniżej znajduje się kilka szybkich linków do kluczowych zasobów w dokumentacji.','General:'=>'Ogólne:','General WordPress Settings'=>'Ogólne ustawienia WordPressa','%1$s Settings'=>'%1$s Ustawienia','Working with Shortcodes:'=>'Praca z kodami skrótowymi:','Shortcode Overview'=>'Przegląd skrótów','Shortcode Builder'=>'Kreator skrótów','Shortcode Parameters Reference'=>'Parametry skrótów – odniesienie','Advanced Topics:'=>'Tematy zaawansowane:','FAQs and Tips'=>'Często zadawane pytania i porady','CSS Guide'=>'Przewodnik po CSS','Developer Resources'=>'Zasoby dla programistów','GDPR'=>'RODO','Loading'=>'Ładowanie','Always use AJAX to render calendars'=>'Zawsze używaj AJAX do renderowania kalendarzy.','AJAX loading is now automatic. You can override AJAX, if necessary, by adding %1$s to your shortcode.'=>'Ładowanie AJAX jest teraz automatyczne. W razie potrzeby można zastąpić AJAX, dodając %1$s do skrótu.','Increase memory limit when rendering calendars'=>'Zwiększ limit pamięci podczas renderowania kalendarzy','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Jeśli kalendarz nie ładuje się i pojawia się błąd krytyczny „brak pamięci”, spróbuj zwiększyć limit pamięci. Zalecane jest minimum 512 MB. %1$s Uwagi: 1) Niektórzy dostawcy usług hostingowych mogą nie zezwalać aplikacjom na zmianę domyślnych ustawień serwera. 2) Nie można ustawić tej opcji na wartość niższą niż aktualny domyślny limit pamięci na serwerze.','deprecated'=>'przestarzały','Some servers may not support the default feed request method. If your feeds are not loading, turn on this option to use the legacy request method. This feature is deprecated and will be removed in a future update.'=>'Niektóre serwery mogą nie obsługiwać domyślnej metody żądania kanałów. Jeśli kanały nie ładują się, włącz tę opcję, aby używać starszej metody żądania. Ta funkcja jest przestarzała i zostanie usunięta w przyszłej aktualizacji.','Default shortcode'=>'Domyślny skrót','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Jeśli Twoja strona będzie zawierała dużą liczbę podobnie skonfigurowanych skrótów kalendarza, możesz wprowadzić tutaj domyślny „podstawowy” skrót z parametrami, które powinny być takie same dla wszystkich kalendarzy. Poszczególne skróty na stronie mogą wtedy zawierać tylko parametry, które są unikalne dla danego kalendarza, na przykład: %1$s Wszelkie parametry zawarte w poszczególnych skrótach zastąpią te ustawione tutaj.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Zezwól na dostęp do tych nazw hostów, które przekierowują do zarezerwowanych adresów IP.','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Jeśli serwer kalendarza jest hostowany na tym samym serwerze fizycznym co strona internetowa, jest częścią tej samej sieci lokalnej lub w inny sposób korzysta z %1$szarezerwowanego adresu IP%2$s, wprowadź tutaj jego nazwę hosta, aby zezwolić na dostęp. W przypadku wielu serwerów kalendarza wprowadź jedną nazwę hosta w każdym wierszu. Więcej informacji można znaleźć w %3$sdokumentacji%4$s%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Wpisz jedną nazwę hosta w każdym wierszu. Nazwy hostów to podstawowe nazwy domen, a nie pełne adresy URL. %1$s Na przykład należy wpisać %2$s, a nie %3$s.','Allow access to these ports'=>'Zezwól na dostęp do tych portów','WordPress automatically allows access to ports 80, 443, and 8080. If you need to be able to access source calendars that use non-standard ports, enter the port numbers here, separated by commas.'=>'WordPress automatycznie zezwala na dostęp do portów 80, 443 i 8080. Jeśli potrzebujesz dostępu do kalendarzy źródłowych, które używają niestandardowych portów, wprowadź tutaj numery portów, oddzielając je przecinkami.','Caching'=>'Buforowanie','Transient (cache) expiration'=>'Wygaśnięcie tymczasowe (pamięć podręczna)','seconds'=>'sekund','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour). Minimum allowed value is 120 (2 minutes).'=>'Określa, jak długo dane kalendarza powinny być buforowane na serwerze (WordPress transients) przed ponownym załadowaniem. Domyślna wartość to 3600 (1 godzina). Minimalna dopuszczalna wartość to 120 (2 minuty).','Admin'=>'Administrator','Minimum access role'=>'Rola minimalnego dostępu','Identifies the minimum user role that is allowed to access %1$s admin pages. Certain areas such as Settings are further restricted to %2$s users only (%3$s users on Multisite configurations).'=>'Określa minimalną rolę użytkownika, która ma dostęp do %1$s stron administracyjnych. Niektóre obszary, takie jak Ustawienia, są dodatkowo ograniczone tylko do %2$s użytkowników (%3$s użytkowników w konfiguracjach wielostronowych).','Register Customizer'=>'Rejestruj dostosowywanie','WordPress no longer includes a link to the Customizer in the Appearance menu when a Block Theme is active. Check this box if you wish to use the Customizer, e.g. for the Additional CSS input. Note: Some themes or plugins may already register the Customizer, in which case, this setting will have no effect. (The checkbox only enables the Customizer when checked; it does not disable the Customizer when unchecked.'=>'WordPress nie zawiera już linku do narzędzia Customizer w menu Wygląd, gdy aktywny jest motyw blokowy. Zaznacz to pole, jeśli chcesz korzystać z narzędzia Customizer, np. w celu wprowadzenia dodatkowego kodu CSS. Uwaga: Niektóre motywy lub wtyczki mogą już rejestrować narzędzie Customizer, w takim przypadku to ustawienie nie będzie miało żadnego wpływu. (Pole wyboru włącza narzędzie Customizer tylko wtedy, gdy jest zaznaczone; nie wyłącza narzędzia Customizer, gdy jest niezaznaczone).','Remove "Add ICS Calendar" button in Classic Editor'=>'Usuń przycisk „Dodaj kalendarz ICS” w edytorze klasycznym.','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Domyślnie kalendarz ICS dodaje przycisk „Dodaj kalendarz ICS” do paska narzędzi nad edytorem WYSIWYG podczas korzystania z edytora klasycznego. Zaznacz to pole, aby usunąć przycisk. Nie ma to wpływu na witryny korzystające z edytora bloków (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s W wersji 10.6 wprowadzono nowe wartości domyślne dla kilku parametrów skrótów. Nowe instalacje automatycznie używają nowych wartości domyślnych, ale zaktualizowane instalacje będą nadal używać starych wartości domyślnych, chyba że zaznaczysz to pole. Więcej informacji na temat tych zmian znajdziesz na %2$snaszym blogu%3$s.','User Guide'=>'Podręcznik użytkownika','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Pełna instrukcja obsługi jest dostępna w wielu językach na naszej stronie internetowej:','For assistance, please use our %1$ssupport request form%2$s.'=>'Aby uzyskać pomoc, prosimy skorzystać z naszego %1$sformularza zgłoszenia pomocy technicznej%2$s.','When contacting support, please include the %1$ssystem report%2$s from this page.'=>'Kontaktując się z pomocą techniczną, prosimy o dołączenie %1$sraportu systemowego%2$s z tej strony.','Spread the word!'=>'Daj znać!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Jeśli uznasz %1$s za przydatne, możesz wesprzeć nasz dalszy rozwój, wystawiając nam %2$spięciogwiazdkową recenzję%3$s. Dziękujemy!','Calendar Status: %1$sPaused%2$s'=>'Status kalendarza: %1$sWstrzymany%2$s','Calendar Status: %1$sActive%2$s'=>'Status kalendarza: %1$sAktywny%2$s','Use the pause button if you need to temporarily turn off %1$s on your front end pages.'=>'Użyj przycisku pauzy, jeśli chcesz tymczasowo wyłączyć %1$s na stronach frontowych.','Resume Calendars'=>'Kalendarze CV','Pause Calendars'=>'Kalendarze pauzy','No content will be altered, but your calendars will be hidden and no %1$s asset files (JavaScript, CSS) will be loaded on front-end pages. If you are using caching via a plugin or through your hosting provider, you may need to clear the cache after changing this setting.'=>'Żadna treść nie zostanie zmieniona, ale Twoje kalendarze zostaną ukryte i żadne pliki zasobów %1$s (JavaScript, CSS) nie będą ładowane na stronach front-endowych. Jeśli korzystasz z buforowania za pomocą wtyczki lub poprzez dostawcę usług hostingowych, po zmianie tego ustawienia może być konieczne wyczyszczenie pamięci podręcznej.','%1$s Data Cache'=>'%1$s Pamięć podręczna danych','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Spowoduje to natychmiastowe wyczyszczenie wszystkich istniejących danych kalendarza z pamięci podręcznej (usunięcie danych przejściowych), zmuszając WordPress do ponownego załadowania wszystkich kalendarzy przy następnym wyświetleniu. Buforowanie zostanie następnie wznowione tak jak poprzednio.','Clear Cached Calendar Data'=>'Wyczyść dane kalendarza z pamięci podręcznej','If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Jeśli korzystasz z wtyczki buforującej innej firmy, po uruchomieniu tego narzędzia może być konieczne wyczyszczenie pamięci podręcznej całej witryny.','Are you sure? This will reset all %1$s settings to their defaults. Your saved calendar configurations and shortcodes will be retained, but resetting the defaults may change the appearance of your calendars. If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Jesteś pewien? Spowoduje to zresetowanie wszystkich ustawień %1$s do wartości domyślnych. Twoje zapisane konfiguracje kalendarza i skróty zostaną zachowane, ale zresetowanie ustawień domyślnych może zmienić wygląd kalendarzy. Jeśli korzystasz z wtyczki buforującej innej firmy, po uruchomieniu tego narzędzia może być konieczne wyczyszczenie pamięci podręcznej całej witryny.','Only clear transients (default)'=>'Tylko wyraźne przejścia (domyślnie)','Also clear all saved ICS feed URLs'=>'Wyczyść również wszystkie zapisane adresy URL kanałów ICS.','Reset %1$sall%2$s %3$s settings (including transients and feed URLs)'=>'Zresetuj %1$swszystkie%2$s %3$s ustawienia (w tym dane przejściowe i adresy URL kanałów)','Last cleared:'=>'Ostatnio wyczyszczone:','never'=>'nigdy','ICS Feed URL Tester'=>'Tester adresu URL kanału ICS','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Jeśli obawiasz się, że wtyczka nie pobiera prawidłowo Twojego kanału, możesz przetestować adres URL tutaj.','Enter feed URL...'=>'Wprowadź adres URL kanału...','Test URL'=>'Testowy adres URL','Results:'=>'Wyniki:','%1$s received.'=>'Otrzymano %1$s.','This appears to be a valid ICS feed URL.'=>'Wydaje się, że jest to prawidłowy adres URL kanału ICS.','unknown'=>'nieznana','This does not appear to be a valid ICS feed URL.'=>'Wydaje się, że ten adres URL kanału ICS jest nieprawidłowy.','Could not retrieve data from the requested URL.'=>'Nie można pobrać danych z podanego adresu URL.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Podczas próby pobrania żądanego adresu URL wystąpił nieznany błąd.','Please copy the following text and include it in your message when emailing support.'=>'Proszę skopiować poniższy tekst i dołączyć go do wiadomości e-mail wysyłanej do działu pomocy technicznej.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Proszę również podać skrót %1$s dokładnie tak, jak został on wpisany na danej stronie.','No events found.'=>'Nie znaleziono wydarzeń.','Previous Page'=>'Poprzednia strona','Next Page'=>'Następna strona','All Day'=>'Cały dzień','Previous Month'=>'Poprzedni miesiąc','Next Month'=>'Następny miesiąc','Today'=>'Dzisiaj','Month selection'=>'Wybór miesiąca','No events.'=>'Brak zdarzeń.','No additional events this month.'=>'W tym miesiącu nie ma żadnych dodatkowych wydarzeń.','Week selection'=>'Wybór tygodnia','Last week'=>'Ostatni tydzień','This week'=>'W tym tygodniu','Next week'=>'Następny tydzień','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Zmień swój kalendarz Google, Microsoft Office 365 lub Apple iCloud w płynnie zintegrowane, automatycznie aktualizowane i niewymagające konserwacji rozwiązanie WordPress.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
